pragma solidity ^0.5.12;

contract VotingCoin {
    mapping (address => uint256) public coinBalance;
    mapping (address => mapping (address => uint256)) public allowance;
    mapping (address => bool) public frozenAccount;
    address public owner;
    uint256 public totalAmount;

    event Transfer(address indexed from, address indexed to, uint256 value);
    event FrozenAccount(address target, bool frozen);

    modifier onlyOwner {
        require(msg.sender == owner);
        _;
    }

    constructor(uint256 _initialSupply) public {
        owner = msg.sender;
        totalAmount = _initialSupply;
        mint(owner, _initialSupply);   
    }

    function buy() public payable {
        require(msg.value >= 1 ether);
        require(coinBalance[owner] >= 2);
        coinBalance[msg.sender] += 2;
        coinBalance[owner] -= 2;
        emit Transfer(owner, msg.sender, 2);  
    }

    function transfer(address _to, uint256 _amount) public {
        require(coinBalance[msg.sender] > _amount);
        require(coinBalance[_to] + _amount >= coinBalance[_to] );
        coinBalance[msg.sender] -= _amount;  
        coinBalance[_to] += _amount;   
        emit Transfer(msg.sender, _to, _amount);  
    }  

    function authorize(address _authorizedAccount, uint256 _allowance)
        public returns (bool success) {
        allowance[msg.sender][_authorizedAccount] = _allowance;
        return true;
    }

    /// @return The balance of `_owner` at the current block
    function balanceOf(address _owner) public view returns (uint256 balance) {
        return (coinBalance[_owner]);
    }


    function transferFrom(address _from, address _to, uint256 _amount) 
        public returns (bool success) {
        require(_to != address(0));                             
        require(coinBalance[_from] >= _amount); 
        require(coinBalance[_to] + _amount >= coinBalance[_to] ); 
        require(_amount <= allowance[_from][owner]);     
        coinBalance[_from] -= _amount;                          
        coinBalance[_to] += _amount;                         
        //allowance[_from][owner] -= _amount;
        emit Transfer(_from, _to, _amount);
        return true;
    }

    function mint(address _recipient, uint256  _mintedAmount) 
        public onlyOwner {
        coinBalance[_recipient] += _mintedAmount;
        //emit Transfer(owner, _recipient, _mintedAmount);
    }

    function freezeAccount(address target, bool freeze) 
        public onlyOwner  {
        frozenAccount[target] = freeze; 
        emit FrozenAccount(target, freeze);
    }
}
